## B. Difference-in-Differences (DID)

To further validate the impact of the FTX collapse on WETH prices, we applied a Difference-in-Differences (DID) approach, using gold prices as a control to account for broader market trends. The DID model is expressed as:

$$
\begin{aligned}
Y_{i t}= & \alpha+\gamma \text { Post }_{t}+\delta \text { Treatment }_{i} \\
& +\theta\left(\text { Post }_{t} \cdot \text { Treatment }_{i}\right)+\epsilon_{i t}
\end{aligned}
$$

where $Y_{i t}$ is the observed WETH price, Post $_{t}$ indicates the post-event period $\left(\right.$ Post $_{t}=1$ if $t \geq T_{0}$ ), and Treatment $_{i}$ identifies whether the observation belongs to the treatment group (WETH). The interaction term $\left(\right.$ Post $_{t} \cdot$ Treatment $\left._{i}\right)$ captures the differential effect of the event on WETH prices relative to the control group (gold). The coefficient $\theta$ represents the causal impact of the event on WETH prices after accounting for market-wide effects [58], [59].
